/* flex thumbnail */
var flex_thumb = function(){
  "use strict";
  $(".flex_thumb").each(function(){
    $(this).find("img").css("opacity",0);
	var $source = $(this).find("img").attr("src");
	$(this).css({
	  'backgroundImage':'url('+ $source +')'
	});
  });
};
/* end flex thumbnail */



/* back to top */
var back_to_top = function(){
  "use strict";
  $(window).scroll(function() {
	if($(this).scrollTop() !== 0) {
	  $('#btt').fadeIn();	
	}else{
	  $('#btt').fadeOut();
	}
  });
 
  $('#btt').click(function() {
    $('body,html').animate({scrollTop:0},800);
  });	
};
/* end back to top */



/* function afterload refresh */
var refresh_up = function(){
  "use strict";
  $(document).scrollTop(0);
  $('html').animate({scrollTop:0}, 1);
  $('body').animate({scrollTop:0}, 1);
};
/* end function afterload refresh */



/* main menu */
var main_menu = function(){
  "use strict";
  $(".open-menu").click(function(){
    $(this).toggleClass("show");
	$("header").toggleClass("flatcolor");
	$("menu").toggleClass("show");
	$(".menu-overlay").fadeToggle("fast");
  });
  
  $(".menu-link, .menu-overlay").click(function(){
    $(".open-menu").removeClass("show");
	$("header").removeClass("flatcolor");
	$("menu").removeClass("show");
	$(".menu-overlay").fadeOut("fast");
  });
};
/* end main menu */



/* scroll reveal show */
var scroll_reveal_show = function(){
  window.sr = ScrollReveal({reset:false,mobile:true,viewFactor:0.4});
  sr.reveal('.about-info > span > .name',50);
  sr.reveal('.about-info > span > .desc > p',50);
  sr.reveal('.ad-number > *',50);
  sr.reveal('.ad-device > ul > li',50);
  sr.reveal('.partner-list > ul > li',50);
};
/* end scroll reveal show */



var scroll_script = function(){
  "use strict";
  $(window).resize(function(e){
    console.log(e);                   
  });
  
  var page_menu = function(){	
	$(window).scroll(function(){
	  var browser_height = parseInt($(window).height());
	  var scroll_position = $(window).scrollTop() + 60;
	  
	  if(scroll_position > 61){$('header, menu').addClass("sticky");}
	  else{$('header, menu').removeClass("sticky");}
	  if(scroll_position > browser_height/2){$('.logo').addClass("show");}
	  else{$('.logo').removeClass("show");}
		
	  /* current pagemenu */
	  var home_top = $('#home').position().top;
	  var home_bottom = home_top + parseInt($('#home').outerHeight());
	  var about_top = $('#about').position().top;
	  var about_bottom = about_top + parseInt($('#about').outerHeight());
	  var audience_top = $('#audience').position().top;
	  var audience_bottom = audience_top + parseInt($('#audience').outerHeight());
	  var partner_top = $('#partner').position().top;
	  var partner_bottom = partner_top + parseInt($('#partner').outerHeight());
	  /*
	  var experience_top = $('#experience').position().top;
	  var experience_bottom = experience_top + parseInt($('#experience').outerHeight());
	  var portofolio_top = $('#portofolio').position().top;
	  var portofolio_bottom = portofolio_top + parseInt($('#portofolio').outerHeight());
	  var contact_top = $('#contact').position().top;
	  var contact_bottom = contact_top + parseInt($('#contact').outerHeight());
	  */
	  
	  if(scroll_position >= home_top && scroll_position < home_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-home').addClass("curr");
	  }
		
	  else if(scroll_position >= about_top && scroll_position < about_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-about').addClass("curr");
	  }
	  else if(scroll_position >= audience_top && scroll_position < audience_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-audience').addClass("curr");
	  }
	  else if(scroll_position >= partner_top && scroll_position < partner_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-partner').addClass("curr");
	  }
		
	  
	  /*
	  else if(scroll_position >= experience_top && scroll_position < experience_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-experience').addClass("curr");
	  }
		
	  else if(scroll_position >= portofolio_top && scroll_position < portofolio_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-portofolio').addClass("curr");
	  }
		
	  else if(scroll_position >= contact_top && scroll_position < contact_bottom){
		$('.menu-link').removeClass("curr");
		$('.menu-contact').addClass("curr");
	  }
	  */
		
	  else{$('.menu-link').removeClass("curr");}
	  /* end current pagemenu */
    });  
  };
  
  
  
  $(document).ready(function(){
    page_menu();
  });
};



/* audience */
var popup_full = function(){
  "use strict";
  $(".popup-full > a").click(function(){
    var myClass = $(this).attr("class");
    $("#" + myClass).fadeIn(100);
	$("html").css("overflow-y","hidden");
  });
  
  $(".pfc-close").click(function(){
    $(this).parent().fadeOut(100);
	$("html").css("overflow-y","auto");
  });
};
/* end audience */



/* audience list */
var adc_popup = function(){
  "use strict";
  $(".adc-button").click(function(){
    $(this).parent().find(".aud-moreinfo").fadeIn("fast");
  });
  
  $(".audm-close").click(function(){
    $(this).parent().fadeOut("fast");
  });
};
/* end audience list */



$(document).ready(function(){
  "use strict";
  flex_thumb();
  back_to_top();
  //refresh_up();
  main_menu();
  scroll_reveal_show();
  scroll_script();
  popup_full();
  adc_popup();
});



$(window).load(function() {
  //refresh_up();
  $(".se-pre-con").fadeOut("slow");
  $(".cd-map > span").load("contact-map.php");
  $('#viva-video-bg').html("<video autoplay=\"\" loop muted><source src=\"http://preview.viva.co.id/viva18/kit/img/sample-trailer.mp4\" type=\"video/mp4\"><source src=\"img/viva-inside.ogg\" type=\"video/ogg\"></video>");
});



